description:
Killing Off Character's music is recorded as a unit, transcending musical roles and assignments. A guitar here for me, a keyboard there for you. Strict music roles have no part here.

Our first singles were recorded and produced by David Stephan, mixed in Toronto by Grammy award winning producer David Botrill (Tool, Peter Gabriel, King Crimson), and mastered in Windsor, Ontario by Scott Warren.


Killing Off Characters are: Martin Foote/James Bennett/David Stephan

